// ViewerControls.js
import React from 'react';

const ViewerControls = () => {
  return (
    <div>
      <button id="toggleZoom">Zoom</button>
      <button id="togglePan">Pan</button>
      <button id="toggleOrbit">Orbit</button>
      <button id="resetBtn">Reset</button>
    </div>
  );
};

export default ViewerControls;
